import React from 'react';
import Admin from './Admin';
import { Container,Navbar } from 'react-bootstrap';

function App() {
  return (

      <Container>
          <Navbar expand="lg" variant="light" bg="light">
            <Navbar.Brand href="#">Navbar</Navbar.Brand>
          </Navbar>
          <Admin/>
      </Container>

  );
}

export default App;
